import React from "react";
import RegistrationNavBar from "../components/RegistrationNavBar"; // Import the NavBar component
import VendorRegistration from "../components/VendorRegistration"; // Import the Vendor Registration component

const RegistrationPage = () => {
  return (
    <div style={{backgroundColor: '#FFFAFA'}}>
      {/* Upper Section */}
      <div className="d-flex justify-content-start m-4" style={{backgroundColor: '#FFFAFA'}}>
        <img
          src={require('../assets/images/addressPageLogo.png')}
          alt="WeedHurry Logo"
          style={{ height: '40px' }}
        />
      </div>

      {/* Main Content Section */}
      <div style={{ margin: 0, padding: 0, backgroundColor: '#fafafa', minHeight: '100vh' }}>
    <VendorRegistration />
  </div>
  <div className="text-center">
        <img
          src={require('../assets/images/addressPageLogoFaint.png')}
          alt="WeedHurry Logo"
          style={{ height: '40px', marginBottom: '10px' }}
        />
        <div>
          <small className="text-muted mb-4">
            <a href="/terms" style={{ textDecoration: 'none', color: 'grey', fontSize: '0.8rem' }}>Terms and Conditions</a>
            {' | '}
            <a href="/privacy" style={{ textDecoration: 'none', color: 'grey', fontSize: '0.8rem' }}>Privacy Policy</a>
          </small>
        </div>
      </div>
    </div>
  );
};

export default RegistrationPage;
